  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113890 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean and South Atlantic Ocean from 2002-10-13 to 2002-11-16 and retrieved during
  cruise CARINA/06MT20021013. These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC
  CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential
  temperature (theta), SALINITY, SILICATE and WATER TEMPERATURE. The instruments used
  to collect these data include CTD and bottle. These data were collected by Douglas
  Wallace of Universitat Kiel; Institut Fur Meereskunde; Forschungsbereich Marine
  Biogeochemie as part of the CARINA/06MT20021013 data set.nnThe CARINA (CARbon dioxide
  IN the Atlantic Ocean) data synthesis project is an international collaborative
  effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced a merged internally
  consistent data set of open ocean subsurface measurements for biogeochemical investigations,
  in particular, studies involving the carbon system. The original focus area was
  the North Atlantic Ocean, but over time the geographic extent expanded and CARINA
  now includes data from the entire Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\":
